import React, { Component } from 'react';
import './Landing.css';
import myImg from '../../assets/images/sara.jpg';
import { skillList } from '../../shared/skills';
import SkillProgress from '../../components/SkillProgress/SkillProgress';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import { faLinkedinIn } from '@fortawesome/free-brands-svg-icons';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { faPinterest } from '@fortawesome/free-brands-svg-icons';
import { faTwitter } from '@fortawesome/free-brands-svg-icons';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';

class Landing extends Component {


    render () {
    let skills =  Object.entries(skillList).map(([key, value]) => 
                    <div className="ProgressBar"><SkillProgress skill={key} percentage={value}/></div>
                );


        return (
            <div>
                <div className="Header">
                    <img src={myImg}></img>

                    <FontAwesomeIcon className="Icons" icon={faEnvelope} style={{color:'white'}}/>
                    <FontAwesomeIcon icon={faGithub} style={{color:'white'}}/>
                    <FontAwesomeIcon icon={faLinkedinIn} style={{color:'white'}}/>
                    <FontAwesomeIcon icon={faPinterest} style={{color:'white'}}/>
                    <FontAwesomeIcon icon={faTwitter} style={{color:'white'}}/>
                </div>
                <div className="AboutMe">
                    <p>Hi, my name is Sara. I am a Software Engineer based in San Francisco. I studied in bachelor of software engineering and master in computere science. I have two years of experience in industry as a data engineer and software engineer. I am expert developing front ends using Angular and React frameworks and I recently started learning SwiftUI and React Native.</p>
                    <a href="#">Read more about me</a>
                </div>
                <div className="OrangeSpace">
                </div>
                <div className="Skills">
                    <h3>Skills & Technologies</h3>
                    <div className="SkillList">
                        {skills}
                    </div>

                </div>
            </div>
        );
    }
}

export default Landing;
